			shellScript = "# Sign the binary tools and the Tunnelblick application itself\ncodesign -s TunnelblickSigning $CODESIGNING_FOLDER_PATH/Contents/Resources/atsystemstart\ncodesign -s TunnelblickSigning $CODESIGNING_FOLDER_PATH/Contents/Resources/installer\ncodesign -s TunnelblickSigning $CODESIGNING_FOLDER_PATH/Contents/Resources/openvpnstart\ncodesign -s TunnelblickSigning $CODESIGNING_FOLDER_PATH/Contents/Resources/standardize-scutil-output\ncodesign -s TunnelblickSigning $CODESIGNING_FOLDER_PATH\n\nif [ ${CONFIGURATION} = \"Release\" ]; then\n\n\t# Staging folder\n\tTMPDMG=build/Release/${PROJECT_NAME}\n\n\t# Folder with files for the .dmg (.DS_Store, background folder which contains background.png background image)\n\tDMG_FILES=dmgFiles\n\n\t# Remove the existing \"staging\" folder and copy the application into it\n\trm -rf $TMPDMG\n\tmkdir -p $TMPDMG\n\tcp -p -R build/Release/${PROJECT_NAME}.app $TMPDMG\n\n\t# Copy link to documentation to the staging folder\n\tcp -p \"Online Documentation.webloc\" $TMPDMG\n\n\t# Copy the background folder and its background.png file, then make the folder invisible in the Finder\n\tcp -p -R $DMG_FILES/background $TMPDMG\n\tsetfile -a V \"$TMPDMG/background\"\n\n\t# Copy dotDS_Store to .DS_Store and make it invisible in the Finder\n\tcp -p -R $DMG_FILES/dotDS_Store \"$TMPDMG/.DS_Store\"\n\tsetfile -a V \"$TMPDMG/.DS_Store\"\n\n\t# Remove any existing .dmg and create a new one. Specify \"-noscrub\" so that .DS_Store is copied to the image\n\trm -rf build/Release/${PROJECT_NAME}.dmg\n\thdiutil create -noscrub -srcfolder $TMPDMG build/Release/${PROJECT_NAME}.dmg\n\nfi";
		};
